// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Permit.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";


contract FractionalCertificateToken is ERC20, Ownable, ERC20Permit, ERC721Holder {

    // The IReCCertificate NFT contract (ERC-721)
    IERC721 public immutable iRecCertificateContract;

    
    uint256 public immutable certificateTokenId;
    bool public isFractionalized;

    // Event emitted when NFT is locked and fractions minted
    event CertificateFractionalized(uint256 tokenId, uint256 totalFractions, address indexed initiator);

    constructor(
        uint256 totalFractions,
        string memory tokenName,
        string memory tokenSymbol,
        address certificateContractAddress,
        uint256 certificateTokenId_
    ) ERC20(tokenName, tokenSymbol) ERC20Permit(tokenName) Ownable(msg.sender) {
        iRecCertificateContract = IERC721(certificateContractAddress);
        certificateTokenId = certificateTokenId_;

        _mint(msg.sender, totalFractions);
    }

    /**
     * @dev Locks the NFT (green energy certificate) inside this contract to fractionalize it.
     */
    function fractionalizeCertificate() external onlyOwner {
        require(!isFractionalized, "Certificate already fractionalized");

        // Transfer certificate NFT to this contract (lock)
        iRecCertificateContract.safeTransferFrom(msg.sender, address(this), certificateTokenId);

        isFractionalized = true;

        emit CertificateFractionalized(certificateTokenId, totalSupply(), msg.sender);
    }

    /**
     * @dev Returns information about the fractionalized certificate
     */
    function getFractionInfo() external view returns (
        address nftAddress,
        uint256 tokenId,
        uint256 totalFractions,
        address ownerAddress
    ) {
        return (
            address(iRecCertificateContract),
            certificateTokenId,
            totalSupply(),
            owner()
        );
    }
}

contracts/IReCCertificate.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
/**
 * @title IReCCertificate
 * @dev Contract for creating I-REC certificates as NFTs (ERC-721)
 */
contract IReCCertificate is ERC721URIStorage, Ownable {

    // Certificate metadata
    struct CertificateData {
        string facilityName;
        string energySource;
        uint256 productionDate;
        uint256 expiryDate;
        uint256 energyAmount; // in Wh (1 MWh = 1,000,000 Wh)
    }

    mapping(uint256 => CertificateData) public certificates;
    mapping(uint256 => address) private tokenIdOwner;

    // Events
    event CertificateMinted(uint256 tokenId, address owner, uint256 energyAmount);
    event CertificateBurned(uint256 tokenId, address burner, uint256 energyAmount);
    event CertificateDetailsUpdated(uint256 tokenId);




    string private baseURIValue;

    constructor(string memory name, string memory symbol, string memory initialBaseURI) ERC721(name, symbol) Ownable(msg.sender) {
        baseURIValue = initialBaseURI;
    }

    /**
     * @dev Override the _baseURI() function from ERC721
     */
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURIValue;
    }

    /**
     * @dev Function to update the base URI if needed
     */
    function setBaseURI(string memory newBaseURI) public onlyOwner {
        baseURIValue = newBaseURI;
    }

    /**
     * @dev Creates a new I-REC certificate as an NFT
     */
    function mintCertificate(
        address recipient,
        string memory baseURI,
        string memory facilityName,
        string memory energySource,
        uint256 productionDate,
        uint256 expiryDate,
        uint256 newItemId
    ) public onlyOwner returns (uint256) {

        _mint(recipient, newItemId);
        _setTokenURI(newItemId, baseURI);

        // Store certificate data (1 MWh = 1,000,000 Wh)
        certificates[newItemId] = CertificateData({
            facilityName: facilityName,
            energySource: energySource,
            productionDate: productionDate,
            expiryDate: expiryDate,
            energyAmount: 1000000 // 1 MWh in Wh
        });

        // Store token ID to the certificate data
        tokenIdOwner[newItemId] = recipient;

        emit CertificateMinted(newItemId, recipient, 1000000);

        return newItemId;
    }

    /**
     * @dev Burns (destroys) an I-REC certificate
     * @param tokenId The ID of the token to burn
     * Requirements:
     * - The caller must own the token or be an approved operator
     */
    function burnCertificate(uint256 tokenId) public {
        require(msg.sender == tokenIdOwner[tokenId], "IReCCertificate: caller is not owner nor approved");

        // Get certificate data before burning for the event
        uint256 energyAmount = certificates[tokenId].energyAmount;

        // Delete certificate data
        delete certificates[tokenId];

        // Burn the token
        _burn(tokenId);

        // Emit burn event
        emit CertificateBurned(tokenId, msg.sender, energyAmount);
    }

    /**
     * @dev Returns the complete details of a certificate
     * @param tokenId The ID of the certificate to query
     */
    function getCertificateDetails(uint256 tokenId) public view returns (
        string memory facilityName,
        string memory energySource,
        uint256 productionDate,
        uint256 expiryDate,
        uint256 energyAmount,
        address owner
    ) {
        require(tokenIdOwner[tokenId] != address(0), "Certificate does not exist");

        CertificateData memory certData = certificates[tokenId];

        return (
            certData.facilityName,
            certData.energySource,
            certData.productionDate,
            certData.expiryDate,
            certData.energyAmount,
            ownerOf(tokenId)
        );
    }
}

contracts/Marketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./FractionalCertificateToken.sol";
import  "./IReCCertificate.sol";


contract Marketplace is Ownable, ReentrancyGuard  {
    struct Listing {
        address seller;
        uint256 pricePerToken; // in wei
        uint256 amountAvailable;
    }

    // Mapping: ERC20 token address => seller => Listing
    mapping(address => mapping(address => Listing)) public listings;

    event Listed(address indexed token, address indexed seller, uint256 amount, uint256 pricePerToken);
    event Purchased(address indexed token, address indexed buyer, uint256 amount, uint256 totalCost);
    event Withdrawn(address indexed seller, uint256 amount);
    event ListingCancelled(address indexed token, address indexed seller);
    // Constructor 
    constructor(address initialOwner) Ownable(initialOwner) {}


    /**
     * @dev Seller lists their fractional tokens
     */
    function listTokens(
        address tokenAddress,
        uint256 amount,
        uint256 pricePerToken
    ) external {
        require(amount > 0 && pricePerToken > 0, "Invalid inputs");

        IERC20 token = IERC20(tokenAddress);
        require(token.allowance(msg.sender, address(this)) >= amount, "Marketplace not approved");
        require(token.balanceOf(msg.sender) >= amount, "Insufficient balance");

        listings[tokenAddress][msg.sender] = Listing(msg.sender, pricePerToken, amount);

        emit Listed(tokenAddress, msg.sender, amount, pricePerToken);
    }

    /**
     * @dev Buyer buys `amountToBuy` of fractional tokens
     */
    function buyTokens(address tokenAddress, address seller, uint256 amountToBuy) external payable nonReentrant {
        Listing storage item = listings[tokenAddress][seller];
        require(item.amountAvailable >= amountToBuy, "Not enough tokens listed");
        
        uint256 totalCost = item.pricePerToken * amountToBuy;
        require(msg.value >= totalCost, "Insufficient ETH sent");

        // Transfer ERC20 tokens from seller to buyer
        IERC20(tokenAddress).transferFrom(item.seller, msg.sender, amountToBuy);

        // Reduce the listing's available amount
        item.amountAvailable -= amountToBuy;

        // Send ETH to seller
        (bool sent, ) = payable(item.seller).call{value: totalCost}("");
        require(sent, "ETH transfer failed");

        emit Purchased(tokenAddress, msg.sender, amountToBuy, totalCost);
    }

    /**
     * @dev Cancel listing
     */
    function cancelListing(address tokenAddress) external {
        Listing storage item = listings[tokenAddress][msg.sender];
        require(item.amountAvailable > 0, "No listing to cancel");

        delete listings[tokenAddress][msg.sender];

        emit ListingCancelled(tokenAddress, msg.sender);
    }

    /**
     * @dev Returns listing details for UI
     */
    function getListing(address tokenAddress, address seller) external view returns (
        address sellerAddress,
        uint256 pricePerToken,
        uint256 amountAvailable
    ) {
        Listing memory l = listings[tokenAddress][seller];
        return (l.seller, l.pricePerToken, l.amountAvailable);
    }
}

